    geo_json_4ae46a8af41b62b4cd759f9f148a0aa0.bindTooltip(
    function(layer){
    let div = L.DomUtil.create('div');
    
    let handleObject = feature=>typeof(feature)=='object' ? JSON.stringify(feature) : feature;
    let fields = ["origin_time_local", "depth", "Ml"];
    let aliases = ["Origin time (local)", "Depth (km)", "Magnitude"];
    let table = '<table>' +
        String(
        fields.map(
        (v,i)=>
        `<tr>
            <th>${aliases[i]}</th>
            
            <td>${handleObject(layer.feature.properties[v])}</td>
        </tr>`).join(''))
    +'</table>';
    div.innerHTML=table;
    
    return div
    }
    ,{"className": "foliumtooltip", "sticky": true});

    function(layer){
    let div = L.DomUtil.create('div');

    let fields = ["event_id", "origin_time", "origin_time_local", "latitude", "longitude", "depth", "Ml"];
    let aliases = ["Event id", "Origin time (UTC)", "Origin time (local)", "Latitude", "Longitude", "Depth (km)", "Magnitude"];

        String(
        fields.map(
        (v,i)=>
        `<tr>
            <th>${aliases[i].toLocaleString()}</th>
            
            <td>${handleObject(layer.feature.properties[v]).toLocaleString()}</td>
        </tr>`).join(''))
    +'</table>';
    div.innerHTML=table;
    
    return div
    }
    ,{"className": "foliumpopup"});
